import React from 'react';
import SerieCard from './SerieCard/SerieCard';

const SerieList = ({series}) => {
  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        flexWrap: 'wrap',
      }}
    >
      {Series
        .map((el, i) => (
          <MovieCard key={i} Serie={el} />
        ))}
    </div>
  );
};

export default SerieList;
